import React, { useContext } from 'react';
import NavBar from "../../components/NavBar";
import { MyContext } from '../../context';
import { useToast, Grid, Box, Flex, Text, Stack, ButtonGroup, Button } from '@chakra-ui/core';

const Dashboard = ({history}) => {
    const context = useContext(MyContext)
    const toast = useToast()

    return (
        <MyContext.Consumer>
            {context => {
                const {isLogged, user} = context.state
                return(
                    <>
                        <NavBar />
                        <Flex align="center">
                            <Flex justify="center" h="90vh" w="20vw">
                                <ButtonGroup spacing={4}>
                                <Stack>
                                    <Button variantColor="teal" variant="solid">
                                        Button
                                    </Button>
                                    <Button variantColor="teal" variant="outline">
                                        Button
                                    </Button>
                                    <Button variantColor="teal" variant="ghost">
                                        Button
                                    </Button>
                                    <Button variantColor="teal" variant="link">
                                        Button
                                    </Button>
                                </Stack>
                                </ButtonGroup>
                            </Flex>
                            <Flex bg="blue.50" size="150px" align="center" justify="center">
                                <Text textAlign="center" bg="pink.50">
                                Box 2
                                </Text>
                            </Flex>
                            <Flex bg="blue.50" size="150px" align="center" justify="center">
                                <Text textAlign="center" bg="pink.50">
                                Box 2
                                </Text>
                            </Flex>
                        </Flex>
                    </>
                )
            }}
        </MyContext.Consumer>
    );
};

export default Dashboard;
